import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav
      style={{
        background: "#1976d2",
        color: "white",
        padding: "10px 20px",
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        borderRadius: "8px",
      }}
    >
      <h2>Inventory Management</h2>
      <div>
        <Link
          to="/dashboard"
          style={{ color: "white", marginRight: "15px", textDecoration: "none" }}
        >
          Dashboard
        </Link>
        <Link
          to="/products"
          style={{ color: "white", marginRight: "15px", textDecoration: "none" }}
        >
          Products
        </Link>
        <Link
          to="/locations"
          style={{ color: "white", marginRight: "15px", textDecoration: "none" }}
        >
          Locations
        </Link>
        <Link
          to="/movements"
          style={{ color: "white", marginRight: "15px", textDecoration: "none" }}
        >
          Movements
        </Link>
        <Link
          to="/report"
          style={{ color: "white", textDecoration: "none" }}
        >
          Report
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
